import React, { useState } from 'react';
import '@fortawesome/fontawesome-free/css/all.min.css';

const ContactUs = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phoneNumber: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form data submitted:', formData);
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.mainHeading}>Contact Us</h1>
      <div style={styles.content}>
        <div style={styles.formBox}>
          <form onSubmit={handleSubmit} style={styles.form}>
            <label style={styles.label}>
              Name:
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                style={styles.input}
              />
            </label>
            <label style={styles.label}>
              Email:
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                style={styles.input}
              />
            </label>
            <label style={styles.label}>
              Phone Number:
              <input
                type="text"
                name="phoneNumber"
                value={formData.phoneNumber}
                onChange={handleChange}
                style={styles.input}
              />
            </label>
            <label style={styles.label}>
              Message:
              <textarea
                name="message"
                value={formData.message}
                onChange={handleChange}
                style={styles.textarea}
              />
            </label>
            <div style={styles.buttonGroup}>
              <button type="reset" style={styles.resetButton}>RESET</button>
              <button type="submit" style={styles.submitButton}>SUBMIT</button>
            </div>
          </form>
        </div>

        <div style={styles.contactBox}>
          <h2 style={styles.contactHeading}>Address</h2>
          <div style={styles.infoRow}>
            <i className="fas fa-map-marker-alt" style={styles.icon}></i>
            <p style={styles.contactDetail}>
              702, Corporate Levels Ayodhya Chowk, 150 Feet Ring Road, Rajkot, Gujarat
            </p>
          </div>
          <div style={styles.infoRow}>
            <i className="fas fa-envelope" style={styles.icon}></i>
            <p style={styles.contactDetail}>
              <a href="mailto:info@bookmysport.co.in" style={styles.emailLink}>
                info@bookmysport.co.in
              </a>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '20px',
    backgroundColor: '#f4f4f4',
    borderRadius: '10px',
    width: '100%', // Changed to full width
    margin: '0 auto',
    boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
    maxWidth: '1200px', // Optional: set a max width for larger screens
  },
  mainHeading: {
    fontSize: '40px',
    fontWeight: 'bold',
    marginBottom: '30px',
    textAlign: 'center',
    color: '#28a745',
  },
  content: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'flex-start',
    gap: '50px',
  },
  formBox: {
    flex: 1,
    backgroundColor: '#fff',
    padding: '20px',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
  },
  label: {
    marginBottom: '10px',
    display: 'block',
    fontWeight: 'bold',
    color: '#333',
  },
  input: {
    padding: '10px',
    marginBottom: '20px',
    borderRadius: '5px',
    border: '1px solid #ccc',
    width: '100%',
    fontSize: '14px',
  },
  textarea: {
    padding: '10px',
    borderRadius: '5px',
    border: '1px solid #ccc',
    width: '100%',
    minHeight: '100px',
    fontSize: '14px',
  },
  buttonGroup: {
    display: 'flex',
    justifyContent: 'space-between',
  },
  resetButton: {
    padding: '12px 20px',
    backgroundColor: 'transparent',
    color: '#28a745',
    border: '1px solid #28a745',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
  submitButton: {
    padding: '12px 20px',
    backgroundColor: '#28a745',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
  contactBox: {
    flex: 1,
    backgroundColor: '#fff',
    padding: '20px',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
  },
  infoRow: {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '15px',
  },
  icon: {
    fontSize: '20px',
    marginRight: '10px',
    color: '#28a745',
  },
  contactHeading: {
    fontSize: '24px',
    marginBottom: '20px',
    color: '#333',
  },
  contactDetail: {
    fontSize: '16px',
    color: '#666',
  },
  emailLink: {
    color: '#28a745',
    textDecoration: 'none',
  },
};

export default ContactUs;
